        console.log(this.props)
        let id1=this.props.match.params.posts_id
        this.setState({
            id:id1
        })
    }
    render() {
        return (
            <div className="container">
            <h4>{this.state.id}</h4>

            </div>
        )
    }
}

export default Posts
